    per individual tax credit per year for Political Action Committee donations.  None
    of the donations which Right to Life/Oregon PAC received in the January 31 Year
    end report for 2007 were over $200 per individual and none accumulated to over
    $200 for the calendar year.  The memo item for 7/07/07 for $648 to AccuZip goes
    with check #253 for $648 to Jane Groff written on 8/09/07.  All memo items for
    8/31/07 belong with check #258 for $7,016.82 written on 8/31/07 to Oregon Right
    to Life.  The memo items on 11/08  for $46.96 and 12/11 for $40.30 to AT&T Mobility
    belong to checks written on those dates to Lois Anderson.  The memo item on 12/17
    for $199.59 written to Mailnet Services belongs to check written to Jane Groff.
    \ All memo items on 12/31 belong with check #283 written to Oregon Right to Life."
